// --- Exported mutable arrays (loaded from localStorage or seed data) ---

export const DEMO_CATEGORIES = [..._SEED_CATEGORIES]

export const DEMO_REMESAS_ALL = loadFromLS(LS_KEYS.remesas) || [..._SEED_REMESAS_ALL.map(r => ({...r}))]
export const DEMO_REMESA_ITEMS_ALL = loadFromLS(LS_KEYS.items) || [..._SEED_REMESA_ITEMS_ALL.map(i => ({...i}))]
export const DEMO_CONTRACTORS_ALL = loadFromLS(LS_KEYS.contractors) || [..._SEED_CONTRACTORS_ALL.map(c => ({...c}))]

export function persistDemoData() {
  try {
    localStorage.setItem(LS_KEYS.remesas, JSON.stringify(DEMO_REMESAS_ALL))
    localStorage.setItem(LS_KEYS.items, JSON.stringify(DEMO_REMESA_ITEMS_ALL))
    localStorage.setItem(LS_KEYS.contractors, JSON.stringify(DEMO_CONTRACTORS_ALL))
  } catch { /* storage full or unavailable */ }
}

export function resetDemoData() {
  localStorage.removeItem(LS_KEYS.remesas)
  localStorage.removeItem(LS_KEYS.items)
  localStorage.removeItem(LS_KEYS.contractors)
  replaceArray(DEMO_REMESAS_ALL, _SEED_REMESAS_ALL.map(r => ({...r})))
  replaceArray(DEMO_REMESA_ITEMS_ALL, _SEED_REMESA_ITEMS_ALL.map(i => ({...i})))
  replaceArray(DEMO_CONTRACTORS_ALL, _SEED_CONTRACTORS_ALL.map(c => ({...c})))
}
